import React from "react";
import heart_icon from '../Assets/heart.png'
import team_work_icon from '../Assets/team-work.png'
import flexibility_icon from '../Assets/flexibility.png'
import clock_icon from '../Assets/clock.png'
import Heading from "./Heading";
import '../Styles/MostProudOf.css'

const MostProudOf = (props) => {
    return(
        <div className="main-container">
            <Heading heading="Most Proud Of" icon={heart_icon}/>
            {
                props.items.map(item => {
                    return(
                        <div className="most-proud-wrapper">
                            <img src={item.icon}/>
                            <div className="most-proud-item-wrapper">
                                <span>{item.title}</span>
                                <span>{item.text}</span>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default MostProudOf;
